selector_to_html = {"a[href=\"#accessing-data-about-newspaper-and-gazette-articles\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">10.1. </span>Accessing data about newspaper and gazette articles<a class=\"headerlink\" href=\"#accessing-data-about-newspaper-and-gazette-articles\" title=\"Permalink to this heading\">#</a></h1><p><img alt=\"Screenshot of Trove web interface displaying basic article metadata\" src=\"../_images/trove-article-metadata.png\"/></p>", "a[href=\"#scraping-positional-information-from-the-web-site\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id9\" role=\"doc-backlink\">Scraping positional information from the web site</a><a class=\"headerlink\" href=\"#scraping-positional-information-from-the-web-site\" title=\"Permalink to this heading\">#</a></h3><p>The OCR process not only extracts text from an image, it generates coordinates that document the position of each piece of text within the parent image. You could use this information to crop an image of the OCRd text out of the parent image. In the case of digitised newspapers, this sort of positional information could help you explore the layout and contents of newspaper pages and how this changes over time.</p><p>No positional information is available from the Trove API, however, there is some embedded within the web site. If you view the source of a newspaper article\u2019s web page, you\u2019ll find a number of <code class=\"docutils literal notranslate\"><span class=\"pre\">&lt;input&gt;</span></code> tags like this:</p>", "a[href=\"#article-text\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id10\" role=\"doc-backlink\">Article text</a><a class=\"headerlink\" href=\"#article-text\" title=\"Permalink to this heading\">#</a></h2><p>Newspaper text is segmented by article. The text is generated by OCR, with manual corrections by volunteers.</p>", "a[href=\"../understanding-search/simple-search-options.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">7.1. </span>\u2018Simple\u2019 search options<a class=\"headerlink\" href=\"#simple-search-options\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"newspapers-and-gazettes-pages.html#download-a-page-image\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id8\" role=\"doc-backlink\">Download a page image</a><a class=\"headerlink\" href=\"#download-a-page-image\" title=\"Permalink to this heading\">#</a></h3><p>Once you know the secret formula, getting page images is easy. You can download a page image using a url like this:</p>", "a[href=\"#zotero-fields\"]": "<table class=\"table\" id=\"zotero-fields\">\n<caption><span class=\"caption-number\">Table 10.1 </span><span class=\"caption-text\">Newspaper and gazette metadata fields extracted by Zotero</span><a class=\"headerlink\" href=\"#zotero-fields\" title=\"Permalink to this table\">#</a></caption>\n<thead>\n<tr class=\"row-odd\"><th class=\"head\"><p>Zotero UI</p></th>\n<th class=\"head\"><p>Zotero field</p></th>\n<th class=\"head\"><p>Value</p></th>\n</tr>\n</thead>\n<tbody>\n<tr class=\"row-even\"><td><p>Item Type</p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">type</span></code></p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">newspaperArticle</span></code></p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Title</p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">title</span></code></p></td>\n<td><p>article heading</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>Publication</p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">publicationTitle</span></code></p></td>\n<td><p>newspaper title (location and date range in brackets is removed)</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Date</p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">date</span></code></p></td>\n<td><p>publication date</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>Place</p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">place</span></code></p></td>\n<td><p>publication state (extracted from newspaper title)</p></td>\n</tr>\n<tr class=\"row-odd\"><td><p>Abstract</p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">abstract</span></code></p></td>\n<td><p>first four lines of text, if available (taken from <code class=\"docutils literal notranslate\"><span class=\"pre\">description</span></code> META tag)</p></td>\n</tr>\n<tr class=\"row-even\"><td><p>URL</p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">url</span></code></p></td>\n<td><p><code class=\"docutils literal notranslate\"><span class=\"pre\">http://nla.gov.au/nla.news-article[article</span> <span class=\"pre\">ID]</span></code></p></td>\n</tr>\n</tbody>\n</table>", "a[href=\"../how-to/create-newspaper-articles-dataset.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">17. </span>How to create a dataset of digitised newspaper articles<a class=\"headerlink\" href=\"#how-to-create-a-dataset-of-digitised-newspaper-articles\" title=\"Permalink to this heading\">#</a></h1>", "a[href=\"#trove-newspaper-harvester\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id7\" role=\"doc-backlink\">Trove Newspaper Harvester</a><a class=\"headerlink\" href=\"#trove-newspaper-harvester\" title=\"Permalink to this heading\">#</a></h3><p><mark>==Where should this go?==</mark></p>", "a[href=\"#trove-lists\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id4\" role=\"doc-backlink\">Trove Lists</a><a class=\"headerlink\" href=\"#trove-lists\" title=\"Permalink to this heading\">#</a></h4><p>Another option for creating collections of manually selected newspaper article metadata is Trove\u2019s built-in Lists function.</p><p><mark>==Note about adding mutliple items to Lists. Hacking the url to get more==</mark></p>", "a[href=\"#bulk-export\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id5\" role=\"doc-backlink\">Bulk export</a><a class=\"headerlink\" href=\"#bulk-export\" title=\"Permalink to this heading\">#</a></h4><p><mark>==Include more info once official documentation is available==</mark></p><p><mark>==Note that there are some differences in fields from the API==</mark></p>", "a[href=\"#api\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id11\" role=\"doc-backlink\">API</a><a class=\"headerlink\" href=\"#api\" title=\"Permalink to this heading\">#</a></h3><p><code class=\"docutils literal notranslate\"><span class=\"pre\">include=articletext</span></code></p><p>Note: includes html\nNote: not the AWW (have to scrape)</p>", "a[href=\"#get-metadata-from-a-search-for-articles-using-the-api\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id6\" role=\"doc-backlink\">Get metadata from a search for articles using the API</a><a class=\"headerlink\" href=\"#get-metadata-from-a-search-for-articles-using-the-api\" title=\"Permalink to this heading\">#</a></h3><p>You can retrieve newspaper and gazette articles using the Trove API\u2019s <code class=\"docutils literal notranslate\"><span class=\"pre\">/result</span></code> endpoint, just set the <code class=\"docutils literal notranslate\"><span class=\"pre\">category</span></code> parameter to <code class=\"docutils literal notranslate\"><span class=\"pre\">newspaper</span></code>.</p><p><a class=\"reference external\" href=\"https://troveconsole.herokuapp.com/v3/?url=https%3A%2F%2Fapi.trove.nla.gov.au%2Fv3%2Fresult%3Fcategory%3Dnewspaper%26encoding%3Djson\"><img alt=\"Try it!\" src=\"../_images/try-trove-api-console.svg\"/></a></p>", "a[href=\"#saving-article-metadata-with-zotero\"]": "<h4 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id3\" role=\"doc-backlink\">Saving article metadata with Zotero</a><a class=\"headerlink\" href=\"#saving-article-metadata-with-zotero\" title=\"Permalink to this heading\">#</a></h4><p><a class=\"reference external\" href=\"https://www.zotero.org/\">Zotero</a> includes a \u2018translator\u2019 for Trove that saves article metadata into your own research database. It also downloads a PDF copy of the article, and saves the OCRd text into an attached note. You can <a class=\"reference external\" href=\"https://www.zotero.org/support/adding_items_to_zotero\">add items</a> by clicking on the Zotero icon in your web browser. The translator extracts metadata from the article web page and citation, rather than the Trove API.</p>", "a[href=\"#article-metadata\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id1\" role=\"doc-backlink\">Article metadata</a><a class=\"headerlink\" href=\"#article-metadata\" title=\"Permalink to this heading\">#</a></h2><p>Newspaper and gazette article metadata includes basic information such as the article heading, publication date, publication title, and page number. Additional information such as attached tags or comments can be also be retrieved from the Trove API.</p>", "a[href=\"#get-metadata-for-an-individual-article\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id8\" role=\"doc-backlink\">Get metadata for an individual article</a><a class=\"headerlink\" href=\"#get-metadata-for-an-individual-article\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"#article-images\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id12\" role=\"doc-backlink\">Article images</a><a class=\"headerlink\" href=\"#article-images\" title=\"Permalink to this heading\">#</a></h2><p>PDF proxy</p><p>Save articles as images</p>", "a[href=\"#save-article-metadata-from-the-web-interface\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><a class=\"toc-backref\" href=\"#id2\" role=\"doc-backlink\">Save article metadata from the web interface</a><a class=\"headerlink\" href=\"#save-article-metadata-from-the-web-interface\" title=\"Permalink to this heading\">#</a></h3><p>Before you dive straight into to the API documentation, remember that there are ways of getting article metadata from the Trove web interface. Each method has its own limitations, but depending on your needs they might do the job. See <a class=\"reference internal\" href=\"../how-to/create-newspaper-articles-dataset.html\"><span class=\"doc std std-doc\">How to create a dataset of digitised newspaper articles</span></a> for further tips.</p>", "a[href=\"trove-lists.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">11. </span>Trove lists<a class=\"headerlink\" href=\"#trove-lists\" title=\"Permalink to this heading\">#</a></h1><h2><span class=\"section-number\">11.1. </span>Metadata<a class=\"headerlink\" href=\"#metadata\" title=\"Permalink to this heading\">#</a></h2><h3>Getting list metadata using the web interface<a class=\"headerlink\" href=\"#getting-list-metadata-using-the-web-interface\" title=\"Permalink to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
